import React from 'react';
import { ButtonGroup, Button } from 'react-bootstrap';
export const Continents = ({ continents }) => {
    const elements = []

    for (const cont of continents) {
        elements.push(<Button variant="secondary">{cont}</Button>)
    }
    return (
        <div>
            <ButtonGroup size="lg" ariel-label="continents">
                {elements}
            </ButtonGroup>
        </div>
        )
}
